import React from "react";
import "./style.css";
import { Navbar, NavItem, Modal, Button, TextInput } from 'react-materialize';

const openStyle = {
    zIndex: 1003,
    display: "block",
    opacity: 1,
    top: "10%",
    transform: "scaleX(1) scaleY(1)"
  }

const NavBar = props => {
    const { handleSignUpClick } = props;
    const { handleLoginClick } = props;
    const { handleLoginClose } = props;
  const { open } = props;
  const style = open ? openStyle : {}
    return (
        <Navbar brand={<a />} alignLinks="right" className="navbar-header z-depth-0">
            <NavItem href="" onClick={handleLoginClick} className="white-text login valign-wrapper modal-trigger">
                Login
                <Modal header="Existing Users Sign In" syle={style} onClick={handleLoginClose} trigger={<Button>Login</Button>}>
      <TextInput icon="accoun-circle" label="User Name" />
      <TextInput icon="lock" label="Password" />

    </Modal>
            </NavItem>

            <NavItem href="" onClick={handleSignUpClick} className="white-text signup valign-wrapper modal-trigger">
                Signup
            </NavItem>
            <NavItem href="/categories" className="white-text fridge valign-wrapper">
                Fridge
            </NavItem>
        </Navbar>
    );
}

export default NavBar;
